import "./portfolio-highlight-style.css";

import LogoPrometheus from "../img/prometheus.svg";

function PortfolioHighligh(props){

    const title = "Fedora Monitoring : Node Exporter, Prometheus, & Grafana";
  return (
    <div id="container">

        <img src={LogoPrometheus} id="logo"/>   
        <div id="overlay"></div>     
        <div id="title">{title}</div>
    </div>
  )
}

export default PortfolioHighligh;
